pragma solidity >=0.8.0 <0.9.0;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

/// @custom:security-contact mario@kentra.media
contract NFT is ERC721Enumerable, Ownable {
    using Strings for uint256;

    // Company & Developers, used for equal part withdrawal
    address[] public teamAddresses;

    // Settings for IPFS Files, ipfs://<ipfs-folder-identifier>
    string public baseURI;

    uint256 private mainSaleCost = 0.05 ether;
    uint256 private presaleCost = 0.04 ether;
    uint256 public cost = presaleCost;

    /* Number of different NFT types, and number of NFTs per Type */
    uint8 public nTypes = 12;
    /*
     * Always set this to "MAX_SUPPLY + 1", this allows to use a more
     * effcient counter and have lower gas fees.
     */
    uint16 public maxSupplyPerType = 1000;
    uint16 public initialSupplyPerType = 0;
    /* Initial number of minted NFTs per Type */
    uint16[12] public currentSupplyPerType = [
    maxSupplyPerType,
    maxSupplyPerType,
    maxSupplyPerType,
    maxSupplyPerType,
    maxSupplyPerType,
    maxSupplyPerType,
    maxSupplyPerType,
    maxSupplyPerType,
    maxSupplyPerType,
    maxSupplyPerType,
    maxSupplyPerType,
    maxSupplyPerType
    ];

    /*
     * Always set this to "MAX_SUPPLY + 1", this allows to use a more
     * effcient counter and have lower gas fees.
     */
    uint16 public maxSupply = maxSupplyPerType * nTypes;

    /* Track allowed NFTs minted per wallet */
    uint16 public maxMintAmount = 20;
    uint16 public nftPerAddressLimit = 3;

    /* Presale activity control */
    uint8 public presaleLimit = 10;
    bool private preSaleActive = true;
    /* Only whitelisted flag for */
    bool public onlyWhitelist = true;

    /* Pause in case of issues */
    bool public paused = false;

    address[] public whitelistedAddresses;

    mapping(address => bool) private isWhitelisted;
    mapping(address => uint16) public addressMintedBalance;
    mapping(address => mapping(uint8 => uint16)) public addressMintedBalanceByType;

    constructor(
        string memory _name,
        string memory _symbol,
        string memory _initBaseURI,
        address[] memory _teamAddresses
    ) ERC721(_name, _symbol) {
        baseURI = _initBaseURI;
        teamAddresses = _teamAddresses;

        for (uint8 i = 0; i < nTypes; i++) {
            currentSupplyPerType[i] = initialSupplyPerType;
        }
    }

    // internal
    function _baseURI() internal view virtual override returns (string memory) {
        return baseURI;
    }

    function random(uint16 range) internal view returns (uint16) {
        return
        uint16(
            (uint256(
            keccak256(abi.encodePacked(block.timestamp, block.difficulty, msg.sender, totalSupply()))
        ) % (range))
        );
    }

    function getRandom(uint16 range) public view returns (uint16) {
        return random(range);
    }

    function getRandomOfType(uint8 _type) public view returns (uint16) {
        require(0 <= _type, "Type ID must be between 0 and 11 inclusive");
        require(_type < nTypes, "Type ID must be between 0 and 11 inclusive");
        require(
            maxSupplyPerType - currentSupplyPerType[_type] > 0,
            "No more nft to be minted for this type"
        );

        return random(maxSupplyPerType - currentSupplyPerType[_type]);
    }

    // public
    function mintType(uint16 _mintAmount, uint8 _type) public payable {
        require(!paused, "the contract is paused");

        // restrictions over all
        uint16 supply = uint16(totalSupply());
        require(_mintAmount > 0, "need to mint at least 1 NFT");
        require(_mintAmount <= maxMintAmount, "max session mint amount exceeded");
        require(supply + _mintAmount <= maxSupply, "max NFT limit exceeded");

        // restriction of type
        require(0 <= _type, "Type ID is 0-11 inclusive");
        require(_type < nTypes, "Type ID is 0-11 inclusive");
        require(
            currentSupplyPerType[_type] + _mintAmount <= maxSupplyPerType,
            "max NFT for this type exceeded"
        );

        // TODO: THIS CAN BE REMOVED IN MAINSALE.
        if (msg.sender != owner()) {
            if (onlyWhitelist == true) {
                require(isWhitelisted[msg.sender], "user is not whitelisted");
                uint16 senderMintedCount = addressMintedBalance[msg.sender];
                require(
                    senderMintedCount + _mintAmount <= nftPerAddressLimit,
                    "max NFT per address exceeded"
                );
            }
            require(msg.value >= cost * _mintAmount, "insufficient funds");
        }

        uint16 typetokenId = 0;
        uint16 fullTokenId = 0;

        for (uint16 i = 1; i <= _mintAmount; i++) {
            typetokenId = getRandomOfType(_type);
            addressMintedBalance[msg.sender]++;
            currentSupplyPerType[_type]++;
            fullTokenId = (_type * maxSupplyPerType) + typetokenId;
            while (_exists(fullTokenId)) {
                typetokenId++;
                fullTokenId = (_type * maxSupplyPerType) + (typetokenId % maxSupplyPerType);
            }
            _safeMint(msg.sender, fullTokenId);
        }
    }

    // TODO: should we have random types? or minting always with defined types?
    // public
    function mint(uint16 _mintAmount) public payable {
        require(!paused, "the contract is paused");
        uint16 supply = uint16(totalSupply());
        require(_mintAmount > 0, "need to mint at least 1 NFT");
        require(_mintAmount <= maxMintAmount, "max mint amount per session exceeded");
        require(supply + _mintAmount <= maxSupply, "max NFT limit exceeded");

        uint8 _ntype = uint8(random(nTypes));

        // TODO: Should minted tokens be of same random type, or all be of different random types?
        while (currentSupplyPerType[_ntype] + _mintAmount > maxSupplyPerType) {
            // TODO: check for endless loop.
            _ntype++;
            _ntype %= nTypes;
        }

        mintType(_mintAmount, _ntype);
    }

    function resumePresale() public onlyOwner {
        restrictToWhitelisted(true);
        cost = presaleCost;
        preSaleActive = true;
    }

    function startMainsale() public onlyOwner {
        restrictToWhitelisted(false);
        cost = mainSaleCost;
        preSaleActive = false;
    }

    function pause(bool _state) public onlyOwner {
        paused = _state;
    }

    function tokenURIByID(uint256 tokenId) public view returns (string memory) {
        require(
            _exists(tokenId) && tokenId <= maxSupply,
            "ERC721Metadata: URI query for nonexistent token"
        );

        string memory currentBaseURI = _baseURI();

        return
        bytes(currentBaseURI).length > 0
        ? string(abi.encodePacked(currentBaseURI, tokenId.toString(), ".json"))
        : "";
    }

    /* show tokens owned by address*/
    function walletOfUser(address _user) public view returns (uint16[] memory) {
        uint16 ownerTokenCount = uint16(balanceOf(_user));
        uint16[] memory tokenIds = new uint16[](ownerTokenCount);
        for (uint16 i; i < ownerTokenCount; i++) {
            tokenIds[i] = uint16(tokenOfOwnerByIndex(_user, i));
        }
        return tokenIds;
    }

    function restrictToWhitelisted(bool _state) public onlyOwner {
        onlyWhitelist = _state;
    }

    function resetWhitelist() public onlyOwner {
        // go through all whitelisted users and set them to false
        for (uint256 i = 0; i < whitelistedAddresses.length; i++) {
            isWhitelisted[whitelistedAddresses[i]] = false;
        }
        // reset the full list of whitelisted users
        delete whitelistedAddresses;
    }

    function removeWhitelistedUser(address _user) public onlyOwner {
        // go through all whitelisted users and set them to false
        isWhitelisted[_user] = false;
    }

    function setTeamAddresses(address[] calldata _teamAddresses) public onlyOwner {
        teamAddresses = _teamAddresses;
    }

    function whitelistUsers(address[] calldata _users) public onlyOwner {
        for (uint256 i = 0; i < _users.length; i++) {
            whitelistUser(_users[i]);
        }
    }

    function whitelistUser(address _user) public onlyOwner {
        whitelistedAddresses.push(_user);
        isWhitelisted[_user] = true;
    }

    function withdraw() public payable onlyOwner {
        // use transfer her instead of send
        uint256 payPerTeam = address(this).balance / teamAddresses.length;
        for (uint256 i = 0; i < teamAddresses.length; i++) {
            transfer(payable(teamAddresses[i]), payPerTeam);
        }
    }

    // Function to transfer Ether from this contract to address from input
    // https://ethereum.stackexchange.com/questions/19341/address-send-vs-address-transfer-best-practice-usage
    function transfer(address payable _to, uint256 _amount) public {
        // Note that "to" is declared as payable
        (bool success, ) = _to.call{ value: _amount }("");
        require(success, "Failed to send Ether");
    }
}
